# Parse the HTML
soup = BeautifulSoup(html_content, 'html.parser')

# Find all menu sections
# Adjust the class name as needed
menu_sections = soup.select('div[name^="menuSection-"]')
print(menu_sections)
menu_data = []

# Loop through each menu section
for section in menu_sections:
    # Adjust the tag to get the section's title, e.g., h2 or h3
    section_name = section.find('h2').text.strip()
    # Adjust the class for menu items
    items = section.find_all(
            'div', class_='menu-item-wrapper__85e3c__LZ+ub')

    section_items = []
    for item in items:
        # Extract name
        
        name = item.find('p', class_='name__85e3c__Hg7cF').text.strip()
        price = item.find('p', class_='price__85e3c__ZQkN9').text.strip()

        # Extract image URL (if present)
        image_tag = item.find('img', class_='menu-item-image')
        image_url = image_tag['src'] if image_tag else None

        # Append to the section's items
        section_items.append({
            'name': name,
            'price': price,
            'image_url': image_url
        })

    # Add to overall menu data
    menu_data.append({
        'section_name': section_name,
        'items': section_items
    })
with open('menu_data_jazzera.json', 'w') as json_file:
    json.dump(menu_data, json_file, indent=4)
